import React from "react";
import "../Footer/Footer.css";

function Footer() {

    return (
        <div className="footer" id="footer-outer-container">
            <div className="page-wrap" id="footer-page-wrap">
                <p>&copy; José Sousa Castro</p>
                <br />
                <label class="label-subject">Programação Avançada em Java</label>
                <br />
                <label class="label-project">Projeto 3</label>
            </div>
        </div>
    );
}

export default Footer;
